import React from 'react';
import {Link, useHistory} from 'react-router-dom';
import './valmis.css';

const ValmisButton = () => {



    return (
        <nav className="Valmis">
            <ul>
                <li><Link to="/Contact"><strong>Valmista?</strong></Link></li>
            </ul>
        </nav>
    );
};

export default ValmisButton;
